import React from "react";
// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  FormGroup,
  Form,
  Input,
  Container,
  Row,
  Col,
  Pagination,
  PaginationItem,
  PaginationLink,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
} from "reactstrap";
// core components
import Header from "components/Headers/Header.js";
import APICountry from "./../../../apis/APICountry";
import APIClient from "./../../../apis/APIClient";

class ShipmentStep1 extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      countries: {},
      documentC: '',
      idC: 0,
      nameC: '',
      lastnameC:'',
      emailC:'',
      cellphone:'',

    };
    this.closeNewShipment = this.closeNewShipment.bind(this);
    this.goNextStep = this.goNextStep.bind(this);
    this.findClientByDocument = this.findClientByDocument.bind(this);
    this.handleChangeIdC = this.handleChangeIdC.bind(this);
    this.handleChangeDocumentC = this.handleChangeDocumentC.bind(this);
    this.handleChangeNameC = this.handleChangeNameC.bind(this);
    this.handleChangeLastnameC = this.handleChangeLastnameC.bind(this);
    this.handleChangeEmailC = this.handleChangeEmailC.bind(this);
    this.handleChangeCellphoneC = this.handleChangeCellphoneC.bind(this);
  }

  closeNewShipment = () => {
    this.props.history.push({
      pathname: "/admin/shipments",
    });
  };

  goNextStep = async () => {
    const countriesService = new APICountry();
    const countries = await countriesService.queryAllCountries();
    //this.setState({ countries: countries });
    this.state.countries = countries;
    //console.log(countries);
    this.props.history.push({
      pathname: "/admin/addShipmentStep2",
      state: {
        countries: this.state.countries,
      },
    });
  };

  handleChangeDocumentC = (event)=>{
    this.setState({
      documentC: event.target.value,
    });
  }
  handleChangeIdC = (event)=>{
    this.setState({
      idC: event.target.value,
    });
  }
  handleChangeNameC = (event)=>{
    this.setState({
      nameC: event.target.value,
    });
  }
  handleChangeLastnameC = (event)=>{
    this.setState({
      lastnameC: event.target.value,
    });
  }
  handleChangeEmailC = (event)=>{
    this.setState({
      emailC: event.target.value,
    });
  }
  handleChangeCellphoneC = (event)=>{
    this.setState({
      cellphoneC: event.target.value,
    });
  }

  findClientByDocument = async() =>{
    const clientService = new APIClient();
    const InformationCLient = await clientService.findClientByDocument(this.state.document);
    


  };


  render() {
    return (
      <>
        <Header />
        <Container className="mt--7" fluid>
          <Row>
            <Card className="bg-secondary shadow" style={{ width: "80rem" }}>
              <CardHeader className="bg-white border-0">
                <Row className="align-items-center">
                  <Col xs="10" className="col-sm">
                    <h3 className="mb-0">1) Información Cliente </h3>
                  </Col>
                  <Col xs="8" className="col-sm">
                    <nav aria-label="...">
                      <Pagination
                        className="pagination justify-content-center mb-0"
                        listClassName="justify-content-end mb-0"
                      >
                        <PaginationItem className="active">
                          <PaginationLink>1</PaginationLink>
                        </PaginationItem>
                        <PaginationItem>
                          <PaginationLink>2</PaginationLink>
                        </PaginationItem>
                        <PaginationItem>
                          <PaginationLink>3</PaginationLink>
                        </PaginationItem>
                        <PaginationItem>
                          <PaginationLink>4</PaginationLink>
                        </PaginationItem>
                      </Pagination>
                    </nav>
                  </Col>
                  <Col className="col-sm text-right" xs="4">
                    <Button
                      className="btn-icon btn-2"
                      color="primary"
                      type="button"
                      onClick={this.closeNewShipment}
                    >
                      <span className="btn-inner--icon">
                        <i className="fas fa-times-circle" />
                      </span>
                    </Button>
                  </Col>
                </Row>
              </CardHeader>
              <CardBody>
                <Form>
                  <div className="pl-lg-4">
                    <Row>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-idClient"
                          >
                            Código de cliente
                          </label>
                          <Input
                            disabled
                            className="form-control-alternative"                            
                            id="input-idClient"
                            placeholder="Código cliente"
                            type="text"
                            value={this.state.idC}
                          />
                        </FormGroup>
                      </Col>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-document"
                          >
                            Número de documento
                          </label>
                          <InputGroup className="mb-4">
                            
                            <Input 
                              placeholder="Buscar" 
                              type="text" 
                              value={this.state.document} 
                              onChange={(ev)=>{this.handleChangeDocumentC(ev)}}/>
                            <InputGroupAddon addonType="prepend" >
                              <Button
                                className="btn-icon btn-2"
                                color="primary"
                                outline
                                type="button"
                                onClick={this.findClientByDocument}
                              >
                                <span className="btn-inner--icon">
                                  <i className="ni ni-zoom-split-in" />
                                </span>
                              </Button>
                            </InputGroupAddon>
                          </InputGroup>
                        </FormGroup>
                      </Col>
                    </Row>
                    <Row>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-first-name"
                            
                          >
                            Nombre
                          </label>
                          <Input
                            className="form-control-alternative"
                            value ={this.state.nameC}
                            id="input-first-name"
                            placeholder="Nombre"
                            type="text"
                            onChange={(ev)=>{this.handleChangeNameC(ev)}}
                          />
                        </FormGroup>
                      </Col>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-last-name"
                          >
                            Apellidos
                          </label>
                          <Input
                            className="form-control-alternative"
                            value={this.state.lastnameC}
                            id="input-last-name"
                            placeholder="Apellidos"
                            type="text"
                            onChange={(ev)=>{this.handleChangeLastnameC(ev)}}
                          />
                        </FormGroup>
                      </Col>
                    </Row>
                    <Row>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-email"
                          >
                            Correo electrónico
                          </label>
                          <Input
                            className="form-control-alternative"
                            value={this.state.emailC}
                            id="input-email"
                            placeholder="Correo Electrónico"
                            type="email"
                            onChange={(ev)=>{this.handleChangeEmailC(ev)}}
                          />
                        </FormGroup>
                      </Col>
                      <Col lg="6">
                        <FormGroup>
                          <label
                            className="form-control-label"
                            htmlFor="input-number"
                          >
                            Número telefónico
                          </label>
                          <Input
                            className="form-control-alternative"
                            value= {this.state.cellphone}
                            id="input-number"
                            placeholder="Número telefónico"
                            type="text"
                            onChange={(ev)=>{this.handleChangeCellphoneC(ev)}}
                          />
                        </FormGroup>
                      </Col>
                    </Row>
                  </div>
                </Form>
                <Row>
                  <Col className="text-right">
                    <Button
                      color="primary"
                      type="button"
                      onClick={this.goNextStep}
                    >
                      Siguiente
                    </Button>
                  </Col>
                </Row>
              </CardBody>
            </Card>
          </Row>
        </Container>
      </>
    );
  }
}
export default ShipmentStep1;
